import React from 'react';
import './../App.css';

export default function UploadForm(props) {

    function uploadButtonClick () {
        alert("hi");
    }

    function onChangeHandler(en) {
        console.log(en);
    }

    return (
        <div className="container" >
            <div className="row">
                <div className="col-md-4">
                    <form>
                        <div className="form-group">
                            <input onChange={onChangeHandler} type="file" className="custom-file-input" id="customFile"/>
                            <label className="custom-file-label margin-top-50" htmlFor="customFile">Choose file</label>
                        </div>
                        <div className="row margin-top-14">
                            <button onClick={uploadButtonClick} className="btn btn-info">Upload</button>
                        </div>
                    </form>
                </div>
            </div>


        </div>
    )

}
